import React from "react";

import "./App.css";

class App extends React.Component {
  state = {
    person: [
      { name: "ali", age: 33 },
      { name: "mo", age: 2 },
      { name: "so", age: 30 },
    ],
  };
  render() {
    return (
      <div className="App">
        <h1>Heloo</h1>
      </div>
    );
  }
}

export default App;
